import React from "react";

import "./privatechat.css";

import UserIcon from "../userIcon/UserIcon";
import PanelHeader from "../panelheader/PanelHeader";


export default function PrivateChat({ users }){

    return(
        <div className="private-channel-panel">
            <PanelHeader
            key={Math.random()*100} 
            title={"Private Channels"} 
            count={users.length} 
            panelWrapperClass={".private-channels"} 
            onAddClick={null}/>
            <div className="private-channels">
                {
                    users.map(user => {
                        return(
                            <div className="private">
                                <UserIcon key={user.id} userName={user.name}/>
                                <p className="member-name">{user.name}</p>
                                <p className="private-message-count">0</p>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    );
};
